@TC | MyShell and other pro miners, I'm a new miner on this sn and want to know your insights/thoughts about surviving on this sn. 

I understand that we need to produce better model (by modifying the training techniques/datasets and other methods) to stay alive, but is it realistically possible for a new miner to survive here given the fact that they are competing against those who might have been mining for days (or even weeks)? 

Is this hypothesis correct or am I missing something? Just asking so I can understand if my efforts, compute and of course the tao to re-register are being put to good use.
